  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Back Bay NWR
  outlines Refuge accomplishments from September through December of 1956. The report
  begins by summarizing the weather conditions, water conditions, and food and cover
  during this period. Wildlife- including migratory birds, upland game birds, furbearers,
  predators, rodents, mammals, raptors, and fish- is also covered. The Refuge development
  and maintenance section discusses physical developments, plantings, and collections
  and receipts. The public relations section of the report describes recreational
  uses, Refuge visitors, Refuge participation, hunting, fishing, and violations. Items
  of interest, N-R forms, and newspaper articles are attached.\",\n\t\"owner_org\":
